B.KU=new A.ay("This experiment was intended to figure out the stored energy released from a 163 gram book when on fire, we did this by using the equation ((Mb - Ma) x C\xb2) / T = ER in which we calculated that in total the fire released around 2.131487781892x1013 joules of stored energy from a 163-gram book in 34 minutes. \n\nThe major issue with this is that the experiment will vary on conditions like wind, heat, mass of the book, size and shape of the container, the time it took to burn. leading to varied outcomes and varied calculations. There is no real way to fix this issue since the variables needed to control this experiment are ever changing.\n\n\n",null,B.Z,null,null,null)
B.KV=new A.ay("In addition to my Learning Plan and Proposal, part of my preperation for this project was to create a research document answering the following questions \n\nWhat is AAC?\nWhat are the main types of AAC devices and programs?\nWhy do people use AAC devices and programs?\nwho are the main demographic thay use AAC devices and programs?\nWhat are the beneficial aspects of AAC devices and programs?\nHow Could AAC Programs and devices be improved?\n\n",null,B.Z,null,null,null)
B.KX=new A.ay("First Project \n\nMy first project at SAPHI got me learning Flutter and Dart, flutter is a programming package which is built on top of dart and allows you to create web, IOS, Android, Linux and windows apps. \nI continued to use this knowledge creating my AAC Program.\n\nSecond Project \n\nMy Second project consisted of me learning Fusion 360 to design an encolsure for an electronics project SAPHI was conducting, this enclosure needed all the electronics to be held on the inside with two ports out, one for a LED power button and one for a solar panel to be connected to the electronics inside.\n\n\n",null,B.Z,null,null,null)
B.KY=new A.ay('Leading up to this project I completed some research onto projects with the Raspberry Pi and Arduino to help decide which I wanted to focus on learning and which will benefit me most to learn. \nI settled onto learning about the Raspberry Pi, answering the following question; \n\n "How can learning from structured projects influence my use of the Raspberry Pi?" \n\nUsing this Question I created a Learning Plan and Project Proposal to help outline my learning;\n\n',null,B.Z,null,null,null)
B.KZ=new A.ay('This project Started out by reading "I used to know that: General Science", where I re-learnt about e=mc\xb2, \nand how that was the formula to figure out how much energy was in an object.\n\nI then came up with idea usng the previous knowledge and the knowledge that fire converts stored energy into other forms of energy,\nI created a science experiment. This science experiment was to figure out ho much energy would be released from a book if you burnt it.\n\n',null,B.Z,null,null,null)
B.L_=new A.ay("SAPHI is a team of elite technologists dedicated to creating the next generation of powerful industrial solutions that set the standard for performance and efficiency. Leveraging the very best in robust technologies, SAPHI produce the solutions that keep clients ahead of the market and deliver turn-key solutions spanning from concept design through to continuous improvement & sustainment.\n\n\n",null,B.Z,null,null,null)
